import json 
import pandas as pd

def iso8601(year, month, day, hour, minute, second):
    date = str(int(year))+ "-" + str(int(month)).zfill(2) + "-" + str(int(day)).zfill(2)
    time = str(int(hour)).zfill(2) + ":" + str(int(minute)).zfill(2) + ":" + str(int(second)).zfill(2)
    utc = date + "T" + time + "Z"
    return utc

def extracttime(utc):
    utc = utc.split('T')
    date = utc[0]
    time = utc[1]
    
    date = date.split("-")
    
    year = float(date[0])
    month = float(date[1])
    day = float(date[2])

    time = time.split(":")
    
    hour = float(time[0])
    minute = float(time[1])
    second = time[2].split(".")
    second = second[0].split("Z")
    second = float(second[0])
    return year,month,day, hour, minute, second

def interval(bound):
    intervals = []
    for i in range(len(bound)-1):
        entry = bound[i] + "/" + bound[i+1]
        intervals.append(entry)
    return intervals

def timeBound(start, end, refresh, length):
    dailysec = 86400
    increment = refresh * 86400
    bound = []
    bound.append(start)
    for i in range(length):
        year, month, day, hour, minute, second = extracttime(bound[i])
        second = second + increment
        minuteinc = int(second/60)
        second = second % 60
        minute = minuteinc + minute
        hourinc = int(minute/60)
        minute = minute % 60
        hour = hour + hourinc
        dayinc = int(hour/24)
        hour = hour % 24
        day = dayinc+ day
        monthinc = int(day/30)
        day = day % 30
        month = monthinc + month
        yearinc = int(month/12)
        month = month % 12
        year = year + yearinc
        utc = iso8601(year,month,day,hour,minute,second)
        bound.append(utc)
    return bound

def grddescriptions(statData):
    description = []
    for k in range(len(statData)):
        columnnames = list(statData[k].columns)
        statDes = []
        for j in range(len(statData[k])):
            sum = ""
            for i in range(len(columnnames)):
                temp = columnnames[i] + ": " + str(statData[k][columnnames[i]].iat[j]) + "<br>"
                sum = sum + temp
            statDes.append(sum)
        description.append(statDes)
    return description

def descriptionEntry(descriptions, intervals):
    entryList = []
    for j in range(len(descriptions)):
        desList = []
        for i in range(len(descriptions[j])):
            entry = {
                "interval": intervals[i],
                "string": descriptions[j][i]
                }
            desList.append(entry)
        entryList.append(desList)
    return entryList
        
    
def grdczml(grdentry, statData, flightEntry, cartesian, start, avail, end):
    packetone = [
        {
            "id": "document",
            "name": "CZML",
            "version": "1.0"
            },
        
        ]
    for i in range(len(grdentry)):
        update = { 
                "id": "Station: " + str(i),
                "name": "Station: " + str(i),
                "availability": start + "/" + end,
                "position": {
                    "cartographicDegrees": [statData[i]["lon"], statData[i]["lat"], 0],
                    },
                "billboard": {
                "image":
                    "data:image/png;base64,",
                "scale": 0.1,
                
                },
                "description": grdentry[i],
                }
        packetone.append(update)
    
    
    for i in range(len(flightEntry)):
        newflight = {
            "id": "flight: " + str(i),
            "availability": avail[i],
            "position": {
              "epoch": start,
              "cartographicDegrees": cartesian[i]
            },
            "billboard": {
                "image":
                    "data:image/png;base64,",
                "scale": 0.1,
                
                },
            "description": flightEntry[i],
            }
        packetone.append(newflight)
    outfile = open("test8.czml", "w")
    
    json.dump(packetone, outfile, indent = 6)
    
    outfile.close()
    
def cartesian4(flightCoord, refresh):
    cart4 = []
    step = refresh*86400
    for i in range(len(flightCoord)):
        coord= []
        for k in range(len(flightCoord[i])):
            coord.append(step*k)
            coord.append(flightCoord[i]["lon"].iat[k])
            coord.append(flightCoord[i]["lat"].iat[k])
            coord.append(150000)
            
        cart4.append(coord)
    return cart4

def availability(bound, flightCoord):
    avail = []
    for i in range(len(flightCoord)):
        start = bound[0]
        end = bound[len(flightCoord[i])]
        interval = start + "/" + end
        avail.append(interval)
    return avail
    